import React from 'react';
import h from './history.module.css'
const History = (props) => {
    console.log(props);
       let showMyTask = () => {
              props.myTask.map( el => {
                     return <HistoryItems el={el} />
              })
             
       }
     return (
       <div>
              {showMyTask}
      </div>
  )
}








const HistoryItems = (props) => {
       return (
              <div className={h.container}>
              <h3>id</h3>
              <h3>id3245356552354534</h3>
              <div className={h.client__container}>
                  <h3>client</h3>
                   <div className={h.items}>
                          <p className={h.items_color}></p>
                          <p >имя</p>
                          <p>phone</p>
                          <p>sity</p>
                          <p>checkPay</p>
                   </div>
                   <div className={h.client__description}>
                          <p>desc</p>
                          <p>desc</p>
                   </div>
              </div>
              <div className={h.executor__container}>
                  <h3>client</h3>
                   <div className={h.items}>
                          <p className={h.items_color}></p>
                          <p >имя</p>
                          <p>surname</p>
                          <p>sity</p>
                          <p>executionTime</p>
                          <p>commentExecutor</p>
                   </div>
              </div>
         </div>
       )
}
export default History;
